DROP TABLE XLAT;
CREATE TABLE XLAT ( 
    ID INTEGER NOT NULL, 
    CLASS VARCHAR (100) ,
    ATTRIBUTE VARCHAR (50) ,
    SHORT_NAME VARCHAR (15) ,
    LONG_NAME VARCHAR (100) , 
    EFFDT DATE NOT NULL ,
    LANG VARCHAR(10));
CREATE UNIQUE INDEX XLAT ON
    XLAT(ID, CLASS, ATTRIBUTE,SHORT_NAME);
